import '../../App.css';
import React, { Component } from 'react';
import { ReactSVG } from 'react-svg';
import EnergySVG from '../../svg/Energy.svg';
import EnergyIcon from '../mainMenu/items/energy';
import { Background, CablesArea, Potentiometer} from './items/components';

class Menu extends Component {
  render(){
    return (
      <div className="equi">
        <Background>
          <Potentiometer/>
            <CablesArea/>
              <div className="grid2x2">
                  <div>
                  <ReactSVG
                    afterInjection={(error, svg) => {
                      if (error) {
                        console.error(error)
                        return
                      }
                      console.log(svg)
                    }}
                    beforeInjection={(svg) => {
                      svg.classList.add('svg-class-name')
                      svg.setAttribute('style', 'width: 300')
                     
                    }}
                    evalScripts="always"
                    fallback={() => <span>Error!</span>}
                    loading={() => <span>Loading</span>}
                    onClick={() => {
                      console.log('wrapper onClick')
                    }}
                    renumerateIRIElements={false}
                    src={EnergySVG}
                    useRequestCache={false}
                    wrapper="div"/>
                  <EnergyIcon/>
                    <ReactSVG
                    afterInjection={(error, svg) => {
                      if (error) {
                        console.error(error)
                        return
                      }
                      console.log(svg)
                    }}
                    beforeInjection={(svg) => {
                      svg.classList.add('svg-class-name')
                      svg.setAttribute('style', 'width: 300')
                      
                    }}
                    evalScripts="always"
                    fallback={() => <span>Error!</span>}
                    loading={() => <span>Loading</span>}
                    onClick={() => {
                      console.log('wrapper onClick')
                    }}
                    renumerateIRIElements={false}
                    src={EnergySVG}
                    useRequestCache={false}
                    wrapper="div"/>
                  </div>
                  <div>
                    <ReactSVG
                    afterInjection={(error, svg) => {
                      if (error) {
                        console.error(error)
                        return
                      }
                      console.log(svg)
                    }}
                    beforeInjection={(svg) => {
                      svg.classList.add('svg-class-name')
                      svg.setAttribute('style', 'width: 300')
                      
                    }}
                    evalScripts="always"
                    fallback={() => <span>Error!</span>}
                    loading={() => <span>Loading</span>}
                    onClick={() => {
                      console.log('wrapper onClick')
                    }}
                    renumerateIRIElements={false}
                    src={EnergySVG}
                    useRequestCache={false}
                    wrapper="div"/>
                  </div>
              </div>
            </Background>
        </div>
    );
  }
}

export default Menu;
